import { createApp } from "vue";
import App from "./App.vue";
import LoginForm from "./components/LoginForm.vue"; // Importa tu componente LoginForm
import { createRouter, createWebHistory } from "vue-router";
import HelloWorld from "./components/HelloWorld.vue";

const router = createRouter({
  history: createWebHistory(),
  routes: [
    { path: "/", component: LoginForm }, // Ruta para el componente principal
    { path: "/login", component: LoginForm }, // Ruta para el componente LoginForm
    { path: "/hello", component: HelloWorld },
  ],
});

createApp(App).use(router).mount("#app");
